import React from 'react';
import Card from './Card';

const CardList = ({robots, colorChange}) => {

return (
<div>
    {
       robots.map ((user, i) => {
            return (
                <Card 
                key = {i} 
                name = {robots[i].name} 
                email = {robots[i].email} 
                id = {robots[i].id}
                colorChange = {colorChange}
                />
            );
        })              
    }
</div>
)}
export default CardList; 

